// SPDX-License-Identifier: MIT

pragma solidity ^0.8.20;

import {IERC1155} from "./interfaces/IERC1155.sol";
import {IERC1155MetadataURI} from "./extensions/IERC1155Metadata.sol";
import {ERC1155Utils} from "./utils/ERC1155Utils.sol";
import {Context} from "./utils/Context.sol";
import {IERC165, ERC165} from "./introspection/ERC165.sol";
import {Arrays} from "./utils/Array.sol";
import {IERC1155Errors} from "./interfaces/draft-IERC6093.sol";

abstract contract ERC1155 is
    Context,
    ERC165,
    IERC1155,
    IERC1155MetadataURI,
    IERC1155Errors
{
    using Arrays for uint256[];
    using Arrays for address[];

    mapping(uint256 id => mapping(address account => uint256))
        private _balances;
    mapping(address account => mapping(address operator => bool))
        private _operatorApprovals;

    string private _uri;

    constructor(string memory uri_) {
        _setURI(uri_);
    }

    function supportsInterface(
        bytes4 interfaceId
    ) public view virtual override(ERC165, IERC165) returns (bool) {
        return
            interfaceId == type(IERC1155).interfaceId ||
            interfaceId == type(IERC1155MetadataURI).interfaceId ||
            super.supportsInterface(interfaceId);
    }

    function uri(uint256) public view virtual returns (string memory) {
        return _uri;
    }

    function balanceOf(
        address account,
        uint256 id
    ) public view virtual returns (uint256) {
        return _balances[id][account];
    }

    function balanceOfBatch(
        address[] memory accounts,
        uint256[] memory ids
    ) public view virtual returns (uint256[] memory) {
        if (accounts.length != ids.length) {
            revert ERC1155InvalidArrayLength(ids.length, accounts.length);
        }

        uint256[] memory batchBalances = new uint256[](accounts.length);

        for (uint256 i = 0; i < accounts.length; ++i) {
            batchBalances[i] = balanceOf(
                accounts.unsafeMemoryAccess(i),
                ids.unsafeMemoryAccess(i)
            );
        }

        return batchBalances;
    }

    function setApprovalForAll(address operator, bool approved) public virtual {
        _setApprovalForAll(_msgSender(), operator, approved);
    }

    function isApprovedForAll(
        address account,
        address operator
    ) public view virtual returns (bool) {
        return _operatorApprovals[account][operator];
    }

    function safeTransferFrom(
        address from,
        address to,
        uint256 id,
        uint256 value,
        bytes memory data
    ) public virtual {
        address sender = _msgSender();

        if (from != sender && !isApprovedForAll(from, sender)) {
            revert ERC1155MissingApprovalForAll(sender, from);
        }
        _safeTransferFrom(from, to, id, value, data);
    }

    function safeBatchTransferFrom(
        address from,
        address to,
        uint256[] memory ids,
        uint256[] memory values,
        bytes memory data
    ) public virtual {
        address sender = _msgSender();
        if (from != sender && !isApprovedForAll(from, sender)) {
            revert ERC1155MissingApprovalForAll(sender, from);
        }
        _safeBatchTransferFrom(from, to, ids, values, data);
    }

    function _update(
        address from,
        address to,
        uint256[] memory ids,
        uint256[] memory values
    ) internal virtual {
        if (ids.length != values.length) {
            revert ERC1155InvalidArrayLength(ids.length, values.length);
        }

        address operator = _msgSender();

        for (uint256 i = 0; i < ids.length; ++i) {
            uint256 id = ids.unsafeMemoryAccess(i);
            uint256 value = values.unsafeMemoryAccess(i);

            if (from != address(0)) {
                uint256 fromBalance = _balances[id][from];
                if (fromBalance < value) {
                    revert ERC1155InsufficientBalance(
                        from,
                        fromBalance,
                        value,
                        id
                    );
                }
                unchecked {
                    _balances[id][from] = fromBalance - value;
                }
            }

            if (to != address(0)) {
                _balances[id][from] += value;
            }
        }

        if (ids.length == 1) {
            uint256 id = ids.unsafeMemoryAccess(0);
            uint256 value = ids.unsafeMemoryAccess(0);
            emit TransferSigle(operator, from, to, id, value);
        } else {
            emit TransferBatch(operator, from, to, ids, values);
        }
    }

    function _updateWithAcceptanceCheck(address from,address to,uint256[] memory ids,uint256[] memory values,bytes memory data) internal virtual{
        _update(from, to, ids, values);
        if(to!=address(0)){
            address operator = _msgSender();
            if(ids.length==1){
                uint256 id = ids.unsafeMemoryAccess(0);
                uint256 value = values.unsafeMemoryAccess(0);
                ERC1155Utils.checkOnERC1155Received(operator, from, to, id, value, data);
            }else{
                ERC1155Utils.checkOnERC1155BatchReceived(operator, from, to, ids, values, data);
            }
        }
    }

    function _safeTransferFrom(address from,address to,uint256 id,uint256 value,bytes memory data) internal{
        if(to==address(0)){
            revert ERC1155InvalidReceiver(address(0));
        }
        if(from == address(0)){
            revert ERC1155InvalidSender(address(0));
        }
        (uint256[] memory ids,uint256[] memory values) = _asSingletonArrays(id,value);
        _updateWithAcceptanceCheck(from, to, ids, values, data);
    }

    function _safeBatchTransferFrom(address from,address to,uint256[] memory ids,uint256[] memory values,bytes memory data) internal{
        if(to==address(0)){
            revert ERC1155InvalidReceiver(address(0));
        }
        if(from==address(0)){
            revert ERC1155InvalidSender(address(0));
        }
        _updateWithAcceptanceCheck(from, to, ids, values, data);
    }

    function _setURI(string memory newuri) internal virtual{
        _uri = newuri;
    }

    function _mint(address to,uint256 id,uint256 value,bytes memory data) internal{
        if(to==address(0)){
            revert ERC1155InvalidReceiver(address(0));
        }
        (uint256[] memory ids,uint256[] memory values) = _asSingletonArrays(id,value);
        _updateWithAcceptanceCheck(address(0), to, ids, values, data);
    }

    function _mintBatch(address to,uint256[] memory ids,uint256[] memory values,bytes memory data) internal{
        if(to == address(0)){
            revert ERC1155InvalidReceiver(address(0));
        }
        _updateWithAcceptanceCheck(address(0), to, ids, values, data);
    }

    function _burn(address from,uint256 id,uint256 value) internal{
        if(from==address(0)){
            revert ERC1155InvalidSender(address(0));
        }
        (uint256[] memory ids,uint256[] memory values) = _asSingletonArrays(id,value);
        _updateWithAcceptanceCheck(from, address(0), ids, values, "");
    }

    function _burnBatch(address from,uint256[] memory ids,uint256[] memory values) internal{
        if(from == address(0)){
            revert ERC1155InvalidSender(address(0));
        }
        _updateWithAcceptanceCheck(from, address(0), ids, values, "");
    }

    function _setApprovalForAll(address owner,address operator,bool approved) internal virtual{
        if(operator == address(0)){
            revert ERC1155InvalidOperator(address(0));
        }
        _operatorApprovals[owner][operator] = approved;
        emit ApprovalForAll(owner, operator, approved);
    }

    function _asSingletonArrays(uint256 element1,uint256 element2) private pure returns(uint256[] memory array1,uint256[] memory array2){
        assembly("memory-safe") {
            array1 := mload(0x40)
            mstore(array1,1)
            mstore(add(array1,0x20),element1)

            array2:=add(array1,0x40)
            mstore(array2,1)
            mstore(add(array2,0x20),element2)

            mstore(0x40,add(array2,0x40))
        }
    }
}

