            for(uint256 it = begin + 0x20;it<end;it+=0x20){
                if(comp(_mload(it),pivot)){
                    pos+= 0x20;
                    _swap(pos,it);
                }
            }

            _swap(begin,pos);
            _quickSort(begin, end, comp);
            _quickSort(pos+0x20, end, comp);
